import { Injectable } from '@angular/core';
import { Observable, } from 'rxjs/Observable';
import { Observer } from 'rxjs';
import { FacialIdentificationService } from 'services/facial-identification.service';

enum WidgetFinishStatusMock {
  Ok = 1,
  Error = 2,
  CancelByUser = 3,
  Timeout = 4
};

enum WidgetErrorTypeMock {
  UnknownError = 1,
  NoError = 2,
  CameraPermissionDenied = 3,
  SettingsPermissionDenied = 4,
  HardwareError = 5,
  ExtractionLicenseError = 6,
  UnexpectedCaptureError = 7,
  ControlNotInitializedError = 8,
  BadExtractorConfiguration = 9
};

const widget = {
  universal: {
    StartWidget (
      onSuccess,
      onError,
      enumModeWidget,
      resourcesPath,
      configuration) {
        const option = confirm('Mock facephi, ok para validar info biometrica y cancelar para forzar error');
        if (option) {
          onSuccess.call(this);
        } else {
          onError.call(this, 'error');
        }
    }
  },
  config: {
    WidgetConfig: class {}
  }
};

const TEMPLATE = '';

/**
 * Implements the calls to external services, ex: MATRICULA_OCR
 */
@Injectable()
export class FacialIdentificationMock extends FacialIdentificationService {

  constructor() {
    super();
    this.widget = widget;
    this.facialService = this.widget.universal;
  }

  public registerUser(): Observable<any> {
    return  Observable.create(observer => {
      this.register$ = observer;
      this.facialService.StartWidget(
        this.onSuccessRegExtraction.bind(this),
        this.onErrorRegExtraction.bind(this),
        this.ENUM_MODE_WIDGET.Register,
        this.resourcesPath,
        this.getConfiguration()
      );
    });
  }

  public authenticateUser() : Observable<any> {
    return Observable.create(observer => {
      this.authenticate$ = observer;
      this.facialService.StartWidget(
        this.onSuccessAuthenticate.bind(this),
        this.onErrorAuthenticate.bind(this),
        this.ENUM_MODE_WIDGET.Authenticate,
        this.resourcesPath,
        this.getConfiguration()
      );
    });
  }

  protected onSuccessAuthenticate() {
    const result = {
      finishStatus: 1,
      template: TEMPLATE,
      livenessDiagnostic: 1,
      errorType: 2,
      eyeGlassesScore: 1,
      templateScore: 0.10759826749563217
    };
    this.onSuccessValidation(result, function(data) {
      this.authenticate$.next(data);
      this.authenticate$.complete();
    }.bind(this))
  }

  protected onSuccessRegExtraction() {
    const result = {
      finishStatus: WidgetFinishStatusMock.Ok,
      errorType: WidgetErrorTypeMock.NoError,
      template: TEMPLATE
    };
    this.onSuccessValidation(result, function(data) {
      this.register$.next(data);
      this.register$.complete();
    }.bind(this))
  }

  protected getConfiguration() {
    return {}
  }

  protected getWidgetCodes() {
    return {
      WidgetErrorTypeProxy: WidgetErrorTypeMock,
      WidgetFinishStatusProxy: WidgetFinishStatusMock
    }
  }
}
